import './App.css';

function App() {
  return (

    function App() {
      return (
        <div className="app">
          <div className="App-header">
            <h3>Sudoku solver</h3>

            <table>
              <tbody>
                {
                  [0, 1, 2, 3, 4, 5, 6, 7, 8].map((row, rIndex) => {
                    return <tr key={rIndex}>
                       {[0,1,2,3,4,5,6,7,8].map((row,cIndex) => {
                        return<td key={rIndex + cIndex} >
                          <input className="cellInput>" />
                        </td>
                      })}
                    </tr>

                  })
                }

              </tbody>
            </table>
          </div>
        </div>
      )
    }
  );
}

export default App;
